import React from 'react';

function FilmListing(props){
  const allFilms = () => props.title.title
    .forEach((title) => {
      console.log(title)
        return <h1>{title}</h1>
    });
  return(
    <div>
      <div className="film-library">
        <div className="film-list">
          <h1 className="section-title">FILMS</h1>
        </div>
      </div>
      {allFilms()}
    </div>
  );
}

export default FilmListing;
